import './LatestGames.css';
import Lacum_div from './sc/Lacum_div';

const LatestGames = () => {
    return (
        <div class="LatestGames">
            <center>
              <h1 class="latest-title">See our latest games</h1>
              <br></br>
              <Lacum_div/>
            </center>
        </div>
    );
};

export default LatestGames;
